import React from 'react'
import { useNavigate } from 'react-router-dom';
const navigate = useNavigate()
function Home() {
  const isLoggedIn = localStorage.getItem('isLoggedIn');
  if (!(isLoggedIn && isLoggedIn === "true")) {
    navigate("/login")
  }
  return (
    <div>Home</div>
  )
}

export default Home
